function Ecommerce() {
  return (
    <ThemeContext.Provider>
      <div>
        Hello, welcome to my e-commerce website.
        <div>
          <button>Click me to change theme.</button>
        </div>
      </div>
    </ThemeContext.Provider>
  );
}

export default Ecommerce;
